import React from "react";
import useGetSetlists from "../useGetSetlists"


function Setlist(props) {


    return (
        <>
            <li key={props._id} className="list-group-item">

                Name: {props.name}  Gig Type: {props.gigtype}

            </li>
        </>
    )
}

export default Setlist;
